import '../tour/Tour.css'
import { Link } from 'react-router-dom'; 
function Tour(props) {
  return (

    <div>
       <Link to={`/city/:${props.id1}`} >
        <div key={props.id}>
          <h2>{props.name}</h2>
          <img src={props.image} alt={props.name} />
        </div>
       </Link>
    </div>

  );
}

export default Tour;
